right_description:
&lt;b&gt;Design Incrível&lt;/b&gt;&lt;br/&gt;Desejo à primeira vista. Amor ao primeiro toque. O exclusivo padrão de onda proporciona estilo e conforto diferenciados. O revestimento UV antirrisco ajuda seu telefone a ter um visual impecável, enquanto o leitor lateral de impressão digital maximiza o espaço traseiro.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Uma tela de respeito&lt;/b&gt;&lt;br/&gt;A tela grande ficou ainda maior. Curta as suas séries favoritas, veja seus vloggers favoritos e jogue como nunca na imensa tela HD+ de 6,6&apos;&apos;. A simplicidade do design Punch Hole garante mais espaço na tela para proporcionar imersão total.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Tecnologia de Som 3D LG&lt;/b&gt;&lt;br/&gt;O mecanismo de som 3D da LG analisou 17 milhões de amostras de áudio para produzir sempre o som ideal. Músicas de todos os gêneros, jogos, podcasts e filmes ficam sempre com som fenomenal.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Câmeras&lt;/b&gt;&lt;br/&gt;4 maneiras de tirar fotos incríveis. A câmera Inteligente de 13MP, a câmera macro de 2MP, a câmera supergrande-angular de 5MP e a câmera de profundidade* de 2MP se unem em um atraente conjunto quádruplo para criar os mais variados tipos de fotos.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Bateria de alta duração&lt;/b&gt;&lt;br/&gt;Feita para durar o dia todo. A bateria de 4.000mAh é o suficiente para que você utilize o seu Smartphone o dia todo sem precisar recarregar.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Aprovado em testes militares&lt;/b&gt;&lt;br/&gt;Acidentes acontecem, mas, com a certificação MIL-STD-810G, seu smartphone consegue aguentar o tranco. Testes militares comprovam que ele pode suportar estilos de vida ativos e quedas eventuais.&lt;br/&gt;&lt;br /&gt;&lt;b&gt;&lt;span style=&apos;font-size:18px;&apos;&gt;
