&lt;b&gt;Visualização mais ampla e aprimorada&lt;/b&gt;&lt;br/&gt;Uma tela enorme para caber tudo. Faça chamadas de vídeo em tela com todo mundo. Assista a filmes e séries. Jogue. Tudo em uma tela de 6,2&quot; V-Notch HD+ 20:9 que se estende de ponta a ponta.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Duplique as opções de foto&lt;/b&gt;&lt;br/&gt;Duas câmeras para você obter o ângulo perfeito. Capture lindos closes da natureza com a Câmera Macro de 2MP. Tire fotos impressionantes, em alta resolução, com a Câmera Traseira de 13MP.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Diga adeus às fotos borradas&lt;/b&gt;&lt;br/&gt;Imagens limpas e detalhadas. A câmera traseira de 13MP é ideal para fotos versáteis em uma ampla gama de situações. A tecnologia PDAF * minimiza a distorção e maximiza o foco para proporcionar fotos incríveis.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Encontre a beleza nas pequenas coisas&lt;/b&gt;&lt;br/&gt;Fotos lindas de coisas pequeninas. Capture fotos de animais de estimação, gotas de chuva ou pétalas de flores, sem precisar aproximar o zoom. A distância focal mínima de 4cm da Câmera Macro mantém o objeto em foco total, mesmo de muito perto.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Processamento máximo&lt;/b&gt;&lt;br/&gt;Faça mais ao mesmo tempo. Alterne facilmente entre aplicativos e tarefas sem interrupções. A plataforma móvel Qualcomm® 215 com processador Quad-Core de 1.3 GHz melhora o desempenho para que tudo seja executado de maneira rápida e eficiente.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Mais espaço para tudo&lt;/b&gt;&lt;br/&gt;Salve sem diminuir a velocidade das coisas. Os 2GB de RAM e os 32GB de ROM trazem velocidade e armazenamento para todos os seus hobbies, seja para criar vídeos de culinária, tirar fotos do jardim ou baixar novos aplicativos.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Bateria de 3.000mAh&lt;/b&gt;&lt;br/&gt;A bateria que acompanha você. Relaxe e curta seus YouTubers preferidos, os filmes mais recentes e os jogos mais irados.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Sempre ao seu lado, com segurança&lt;/b&gt;&lt;br/&gt;Nunca decepciona. O Smartphone é tão resistente que temperaturas extremas, quedas, vibrações e umidade não podem detê-lo. Com o MIL-STD-810G, mesmo quando ocorrem acidentes, não precisa se preocupar.&lt;br/&gt;&lt;br /&gt;&lt;b&gt;&lt;span style=&apos;font-size:18px;&apos;&gt;
